import React from 'react';
import './modal.css';

const Modal = () => {
	return (
		<div className='modal no-dis'>
			<div className='modal-content'>
				<span className='close-btn'>&times;</span>
				<h2>this is the modal</h2>
			</div>
		</div>
	)
}

export default Modal;
